pragma solidity ^0.6.0;

import "./HToken.sol";

/**
 * @title Hades' HEther Contract
 * @notice HToken which wraps Ether
 * @author Hades
 */
contract HEther is HToken {
	/**
	 * @notice Construct a new HEther money market
	 * @param _admin Address of the administrator of this token
	 * @param _controller The address of the MarketController
	 * @param _interestRateStrategy The address of the interest rate model
	 * @param _name ERC-20 name of this token
	 * @param _symbol ERC-20 symbol of this token
	 */
	function initialize(
		address payable _admin,
		MarketControllerInterface _controller,
		InterestRateStrategyInterface _interestRateStrategy,
		DistributorInterface _distributor,
		string calldata _name,
		string calldata _symbol
	) external {
		super.initialize(_admin, _controller, _interestRateStrategy, _distributor, _name, _symbol, "ETH");
	}

	/*** User Interface ***/

	/**
	 * @notice Sender supplies assets into the market and receives hTokens in exchange
	 * @dev Reverts upon any failure
	 */
	function mint() external payable {
		(uint256 err, ) = mintInternal(msg.value);
		requireNoError(err, "mint failed");
	}

	/**
	 * @notice Sender redeems hTokens in exchange for the underlying asset
	 * @dev Accrues interest whether or not the operation succeeds, unless reverted
	 * @param redeemTokens The number of hTokens to redeem into underlying
	 * @return uint 0=success, otherwise a failure (see ErrorReporter.sol for details)
	 */
	function redeem(uint256 redeemTokens) external returns (uint256) {
		return redeemInternal(redeemTokens);
	}

	/**
	 * @notice Sender redeems hTokens in exchange for a specified amount of underlying asset
	 * @dev Accrues interest whether or not the operation succeeds, unless reverted
	 * @param redeemAmount The amount of underlying to redeem
	 * @return uint 0=success, otherwise a failure (see ErrorReporter.sol for details)
	 */
	function redeemUnderlying(uint256 redeemAmount) external returns (uint256) {
		return redeemUnderlyingInternal(redeemAmount);
	}

	/**
	 * @notice Sender borrows assets from the protocol to their own address
	 * @param borrowAmount The amount of the underlying asset to borrow
	 * @return uint 0=success, otherwise a failure (see ErrorReporter.sol for details)
	 */
	function borrow(uint256 borrowAmount) external returns (uint256) {
		return borrowInternal(borrowAmount);
	}

	/**
	 * @notice Sender repays their own borrow
	 * @dev Reverts upon any failure
	 */
	function repayBorrow() external payable {
		(uint256 err, ) = repayBorrowInternal(msg.value);
		requireNoError(err, "repayBorrow failed");
	}

	/**
	 * @notice Sender repays a borrow belonging to borrower
	 * @dev Reverts upon any failure
	 * @param borrower the account with the debt being payed off
	 */
	function repayBorrowBehalf(address borrower) external payable {
		(uint256 err, ) = repayBorrowBehalfInternal(borrower, msg.value);
		requireNoError(err, "repayBorrowBehalf failed");
	}

	/**
	 * @notice The sender liquidates the borrowers collateral.
	 *  The collateral seized is transferred to the liquidator.
	 * @dev Reverts upon any failure
	 * @param borrower The borrower of this hToken to be liquidated
	 * @param hTokenCollateral The market in which to seize collateral from the borrower
	 */
	function liquidateBorrow(address borrower, HToken hTokenCollateral) external payable {
		(uint256 err, ) = liquidateBorrowInternal(borrower, msg.value, hTokenCollateral);
		requireNoError(err, "liquidateBorrow failed");
	}

	/**
	 * @notice Send Ether to HEther to mint
	 */
	/* solium-disable-next-line */
	receive() external payable {
		(uint256 err, ) = mintInternal(msg.value);
		requireNoError(err, "mint failed");
	}

	/*** Safe Token ***/

	/**
	 * @notice Gets balance of this contract in terms of Ether, before this message
	 * @dev This excludes the value of the current message, if any
	 * @return The quantity of Ether owned by this contract
	 */
	function getCashPrior() internal override view returns (uint256) {
		(MathError err, uint256 startingBalance) = subUInt(address(this).balance, msg.value);
		require(err == MathError.NO_ERROR, "HEther::getCashPrior: unexpected cash");
		return startingBalance;
	}

	/**
	 * @notice Perform the actual transfer in, which is a no-op
	 * @param from Address sending the Ether
	 * @param amount Amount of Ether being sent
	 * @return The actual amount of Ether transferred
	 */
	function doTransferIn(address from, uint256 amount) internal override returns (uint256) {
		// Sanity checks
		require(msg.sender == from, "sender mismatch");
		require(msg.value == amount, "value mismatch");
		return amount;
	}

	function doTransferOut(address payable to, uint256 amount) internal override {
		/* Send the Ether, with minimal gas and revert on failure */
		to.transfer(amount);
	}

	function requireNoError(uint256 errCode, string memory message) internal pure {
		if (errCode == uint256(Error.NO_ERROR)) {
			return;
		}

		bytes memory fullMessage = new bytes(bytes(message).length + 5);
		uint256 i;

		for (i = 0; i < bytes(message).length; i++) {
			fullMessage[i] = bytes(message)[i];
		}

		fullMessage[i + 0] = bytes1(uint8(32));
		fullMessage[i + 1] = bytes1(uint8(40));
		fullMessage[i + 2] = bytes1(uint8(48 + (errCode / 10)));
		fullMessage[i + 3] = bytes1(uint8(48 + (errCode % 10)));
		fullMessage[i + 4] = bytes1(uint8(41));

		require(errCode == uint256(Error.NO_ERROR), string(fullMessage));
	}
}

